import React from "react";
import { Link, useNavigate } from "react-router-dom";
import './style.scss'
import logo from '../../img/header_img/logo.png';
import search from '../../img/header_img/search_icon.png'
import basket from '../../img/header_img/basket_icon.png'

export const Header = () => {
    const navigation = useNavigate();

    return (
        <header className="header">
            <div className="header__wrap">

                <div className="header__logo">
                    <img src={logo} />
                </div>

                <div className="header__link-wrap">
                    <Link className="header__link" to={"/"}>Home</Link>

                    <Link className="header__link" to={"/register"}>Register</Link>

                    <Link className="header__link" to={"/auth"}>Auth</Link>

                    <Link className="header__link" to={"/list"}>list</Link>

                    <Link className="header__link" to={"/products"}>products</Link>

                    <img src={search} className="header__search"></img>

                    <img src={basket} className="header__basket"></img>
                </div>

                <button className="header__button">Sign Up</button>
            </div>
        </header>
    );
}

export default Header;
